import ClipLoader from "react-spinners/ClipLoader";
import { useState } from "react";

import React from "react";

const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
`;

export default function Loader() {
    console.log('loader')
   const loading = true
  return (
    <div>
      <ClipLoader
        css={override}
        sizeUnit={"px"}
        size={150}
        color={"#123abc"}
        loading={loading}
      />
    </div>
  );
}
